import React from 'react';
import Sdata from './Sdata';

function Projects() {
    return (
        <div className="p_item">
            <div className="portfolio_content">
                <a href="Portfolio"><img src={Sdata[0].imgsrc} alt=""/></a>
                <div className="text">
                    <a href="Portfolio"><h4>{Sdata[0].title}</h4></a>    
                    <a href="Portfolio#">{Sdata[0].title}</a>                        
                </div>                               
            </div>                                                
        </div>
    )
}

export default Projects;
